let thumbLabelInstance = null;
module.exports = class thumblabel {

    constructor() {
        if (!thumbLabelInstance) {
            thumbLabelInstance = this;
            //set all other default values

            this.displayAs = 'Show Thumb Label';
            this.value = 'thumbLabel'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return thumbLabelInstance;
    }
}